INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "ペコリーヌとの出会い", 2, 20063115, 1, "フリーマーケット会場", "青空の下で謁見", 10118, 2834, 7, 5118061, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "マホとの出会い", 2, 20063115, 1, "フリーマーケット会場", "未来の騎空団\nマスコット？", 10118, 2835, 7, 5118062, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "アキノとの出会い", 2, 20063115, 1, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 10118, 2837, 7, 5118063, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "ジュンとの出会い", 2, 20063115, 1, "フリーマーケット会場", "黄金色の悩みごと", 10118, 4108402, 18, 5118064, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "カオリとの出会い", 2, 20063115, 1, "フリーマーケット会場", "白熱！　格闘大会！", 10118, 4107402, 18, 5118065, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "ニノンとの出会い", 2, 20063115, 1, "オーエド町", "祭り太鼓はオーエドの華", 10118, 9000227, 16, 5118066, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "スズナとの出会い", 3, 20063115, 1, "フリーマーケット会場", "人気者は遅れて\nやってくる", 10118, 2101181, 19, 5118067, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "ナナカとの出会い", 3, 20063115, 1, "ランドソル市街地", "巫女・ミーツ・魔法少女", 10118, 4109402, 18, 5118068, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "キャル＆コッコロとの出会い", 3, 20063115, 1, "フリーマーケット会場", "ネズ耳は二度なくなる", 10118, 4305402, 18, 5118069, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "ユカリとの出会い", 3, 20063115, 1, "ランドソル市街地", "この出会いにカンパイ！", 10118, 4101402, 18, 5118070, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "アオイとの出会い", 3, 20063115, 1, "ランドソル市街地", "陰陽アンサンブル", 10118, 4106402, 18, 5118071, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, "シノブとの出会い", 3, 20063115, 1, "フリーマーケット会場", "運試し十番勝負！", 10118, 2836, 7, 5118072, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, 8);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (0, "オープニング", 1, 20063115, 0, 0, "彼女たちの新たな日常", 10118, 0, 0, 5118600, 0, 0, 0, 0);
